import React, { Component } from 'react';
import Teams from '../Components/Teams'
class User extends Component {


state = {
  teams: null,
}

componentDidMount(){
  fetch('http://localhost:3000/teams')
  .then(res => res.json())
  .then(teams => this.setState({ teams }))

}

  render() {
    console.log("test3",this.props.user);
    return (
      <React.Fragment>

      {this.props.user === null
        ? null
        : <div>
        <h1>Name:{this.props.user.data.attributes.username}</h1>
          <div className="image">
          <img alt="hello" src={this.props.user.data.attributes.avitar} />
          </div>
          <div>
          Wins:{this.props.user.data.attributes.wins}<br></br>
          Losses:{this.props.user.data.attributes.losses}
          </div>
          <div>
          {this.state.teams === null
            ? null
            : <div>
            <Teams
            user={this.props.user}
            teams={this.state.teams}
            />
            </div>
          }
          </div>
          </div>
      }
      </React.Fragment>
    );
  }

}

export default User;
